import React, { useState, useEffect } from "react";
import axios from "axios";

function DataFetch() {
  const [items, setItems] = useState([]);

    useEffect(() => {
        axios.get("https://dummyjson.com/todos")
            .then(res => {
                setItems(res.data.todos)
            })
            .catch(error => {
                alert(error);
            })
    }, [])
    return (items)
}

export default DataFetch
